import React, { useState } from 'react'
import { Container, Nav, Navbar, NavDropdown } from 'react-bootstrap'
import StaticSunBurst from '../buildCharts/sunBurstChart/StaticSunBurst'
import BoxPlot from '../charts/BoxPlot'
import StaticBoxPlot from '../buildCharts/boxPlotChart/StaticBoxPlot'
import WordCloud from '../charts/WordCloud'
import StaticWordCloud from '../buildCharts/wordCloudChart/StaticWordCloud'
import StaticStackedBar from '../buildCharts/stackedBarChart/StaticStackedBar'
import StaticTimeLine from '../buildCharts/timeLineChart/StaticTimeLine'
import StaticPie from '../buildCharts/pieChart/StaticPie'
import StaticPie1 from '../buildCharts/pieChart/StaticPie1'
import {
  Card,
  CardBody,
  CardHeader,
  CardTitle,
  Col,
  Dropdown,
  DropdownItem,
  DropdownMenu,
  DropdownToggle,
  Row,
} from 'reactstrap'

const ChooseCharts = ({
  title,
  activeLabel,
  showChart,
  boxPlotData,
  wordCloudData,
  timeLineData,
  sunburstData,
}) => {
  const [activeChart, setActiveChart] = useState(activeLabel)
  const [chartTitle, setChartTitle] = useState(title)

  const handleSelect = (eventKey) => {
    setActiveChart(eventKey)
    setChartTitle(eventKey)
  }

  const renderActiveChart = () => {
    switch (activeChart) {
      case 'SunBurst':
        return <StaticSunBurst data={sunburstData} />
      case 'BoxPlot':
        return boxPlotData.length > 0 ? (
          <BoxPlot data={boxPlotData} />
        ) : (
          <StaticBoxPlot />
        )
      case 'WordCloud':
        return wordCloudData.length > 0 ? (
          <WordCloud data={wordCloudData} />
        ) : (
          <StaticWordCloud />
        )
      case 'StackedBar':
        return <StaticStackedBar />
      case 'TimeLine':
        return timeLineData.length > 0 ? (
          <StaticTimeLine
            data={timeLineData}
            onDataReceived={onDataReceived}
            onWordDataReceived={onWordDataReceived}
            onExpLabelReceived={onSunburstLabelReceived}
            onExpDataReceived={onSunburstDataReceived}
            onEventTypeColor={eventTypeColor}
          />
        ) : (
          <StaticTimeLine
            onEventTypeColor={eventTypeColor}
            onDataReceived={onDataReceived}
            onExpLabelReceived={onSunburstLabelReceived}
            onExpDataReceived={onSunburstDataReceived}
            onWordDataReceived={onWordDataReceived}
          />
        )
      case 'PieChart1':
        return <StaticPie />
      case 'PieChart2':
        return <StaticPie1 />
      default:
        return null
    }
  }

  return (
    <div>
      <Card className="card-chart" style={{ backgroundColor: '#27293d' }}>
        <CardHeader>
          <Row>
            <Col className="text-left">
              <CardTitle style={{ color: 'burlywood' }}>{chartTitle}</CardTitle>
            </Col>
            <Col sm="5">
              <Dropdown
                style={{ display: 'flex', flexDirection: 'row-reverse' }}
                isOpen={dropdownOpen}
                toggle={toggle}
              >
                <DropdownToggle>Choose a Chart</DropdownToggle>
                {showChart && (
                  <DropdownMenu>
                    <DropdownItem eventKey="SunBurst">
                      Sunburst Chart
                    </DropdownItem>
                    <DropdownItem eventKey="BoxPlot">
                      Box Plot Chart
                    </DropdownItem>
                    <DropdownItem eventKey="WordCloud">
                      WordCloud Chart
                    </DropdownItem>
                    <DropdownItem eventKey="StackedBar">
                      Stacked Bar Chart
                    </DropdownItem>
                    <DropdownItem eventKey="PieChart1">
                      Pie Chart 1
                    </DropdownItem>
                    <DropdownItem eventKey="PieChart2">
                      Pie Chart 2
                    </DropdownItem>
                    <DropdownItem>Quo Action</DropdownItem>
                  </DropdownMenu>
                )}
              </Dropdown>
            </Col>
          </Row>
        </CardHeader>
        <CardBody style={{ color: 'burlywood' }}>
          {renderActiveChart()}
        </CardBody>
      </Card>
    </div>
  )
}

export default ChooseCharts
